import React from 'react';

function Ranking() {
  // ダミーデータ
  const rankings = [
    { id: 1, name: 'ユーザー1', coins: 100 },
    { id: 2, name: 'ユーザー2', coins: 80 },
    { id: 3, name: 'ユーザー3', coins: 60 },
    { id: 4, name: 'ユーザー4', coins: 40 },
    { id: 5, name: 'ユーザー5', coins: 20 },
  ];

  return (
    <div className="container">
      <h2>ランキング</h2>
      <ul>
        {rankings.map((user) => (
          <li key={user.id}>
            {user.name}: {user.coins}コイン
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Ranking;
